import styled from 'styled-components';

export const TH = styled.th`
width: 12.5%;
height: 50px;
border-bottom: 2px solid black;
border-right: 2px solid black;
border-left: 2px solid black;
background-color: darkgray;
`

export const TR = styled.tr`
width: 100%;
height: 50px;
border-bottom: 2px solid black;
`
export const TD = styled.td`
background-color: lightgrey;
width: 12.5%;
height: 50px;
border-bottom: 2px solid black;
border-left: 2px solid black;
border-right: 2px solid black;
text-align: center;
`

export const Table = styled.table`
width: 100%;
height: 100%;
overflow-y: scroll;
`

const IntervalsCountDisplay = () => {
    return (
        <>
                    <Table>
                    <TR>
                        <TH><Select><option>Ride Name</option></Select></TH>
                        <TH><SelectTimeFrame><option>Day</option><option>Hour</option><option>Week</option><option>Month</option></SelectTimeFrame> Change</TH>
                        <TH><SelectTimeFrame><option>Day</option><option>Hour</option><option>Week</option><option>Month</option></SelectTimeFrame> % Change</TH>
                    </TR>
                    <TR>
                        <TD></TD>  <TD></TD>  <TD></TD>
                    </TR>
                    <TR>
                        <TD></TD>  <TD></TD>  <TD></TD>
                    </TR>
                    <TR>
                        <TD></TD>  <TD></TD>  <TD></TD>
                    </TR>
                    <TR>
                        <TD></TD>  <TD></TD>  <TD></TD>
                    </TR>

                    <TR>
                        <TD></TD>  <TD></TD>  <TD></TD>
                    </TR>


                    </Table>
        </>
    )
}

export default IntervalsCountDisplay
